{
  "$schema": "https://vega.github.io/schema/vega-lite/v5.json",

  "title": "StreamGraph: Traffic Flow by Method",

  "view": {
    "continuousWidth": 1000,
    "continuousHeight": 450
  },

  "data": {
    "url": {
      "%context%": true,
      "%timefield%": "@timestamp",
      "index": "logs-*",
      "body": {
        "size": 0,
        "aggs": {
          "time": {
            "date_histogram": {
              "field": "@timestamp",
              "fixed_interval": "1m",
              "min_doc_count": 0
            },
            "aggs": {
              "methods": {
                "terms": {
                  "field": "method",
                  "size": 20
                }
              }
            }
          }
        }
      }
    },
    "format": { "property": "aggregations.time.buckets" }
  },

  "transform": [
    { "flatten": ["methods.buckets"] },
    { "calculate": "datum['methods.buckets'].key", "as": "method" },
    { "calculate": "datum['methods.buckets'].doc_count", "as": "count" },
    { "calculate": "toDate(datum.key_as_string)", "as": "timestamp" },
    { "filter": "isValid(datum.method) && isValid(datum.count)" }
  ],

  "mark": {
    "type": "area",
    "interpolate": "monotone"
  },

  "encoding": {
    "x": {
      "field": "timestamp",
      "type": "temporal",
      "title": "Time"
    },
    "y": {
      "field": "count",
      "type": "quantitative",
      "stack": "center",
      "title": "Traffic volume"
    },
    "color": {
      "field": "method",
      "type": "nominal",
      "title": "Method",
      "scale": { "scheme": "category20" }
    },
    "tooltip": [
      { "field": "timestamp", "title": "Time" },
      { "field": "method", "title": "Method" },
      { "field": "count", "title": "Count" }
    ]
  }
}

{
  "$schema": "https://vega.github.io/schema/vega-lite/v5.json",
  "title": "Radial Duration Chart per Method",
  "data": {
    "url": {
      "%context%": true,
      "%timefield%": "@timestamp",
      "index": "logs-*",
      "body": {
        "size": 0,
        "aggs": {
          "methods": {
            "terms": {
              "field": "method",
              "size": 20
            },
            "aggs": {
              "avg_duration": { "avg": { "field": "duration_ms" } }
            }
          }
        }
      }
    },
    "format": { "property": "aggregations.methods.buckets" }
  },

  "transform": [
    { "calculate": "datum.key", "as": "method" },
    { "calculate": "datum.avg_duration.value", "as": "duration" },
    { "filter": "isValid(datum.duration)" }
  ],

  "mark": { "type": "arc", "innerRadius": 40, "stroke": "#fff" },

  "encoding": {
    "theta": {
      "field": "duration",
      "type": "quantitative",
      "stack": true,
      "title": "Avg duration"
    },
    "radius": {
      "field": "duration",
      "type": "quantitative",
      "scale": { "domainMin": 0 },
      "title": "Avg duration (ms)"
    },
    "color": {
      "field": "method",
      "type": "nominal",
      "scale": { "scheme": "tableau10" }
    },
    "tooltip": [
      { "field": "method", "title": "Method" },
      { "field": "duration", "title": "Avg duration (ms)", "format": ".2f" }
    ]
  }
}

{
  "$schema": "https://vega.github.io/schema/vega-lite/v5.json",
  "title": "Pareto: status_code",
  "data": {
    "url": {
      "%context%": true,
      "%timefield%": "@timestamp",
      "index": "logs-*",
      "body": {
        "size": 0,
        "aggs": {
          "codes": {
            "terms": {
              "field": "status_code",
              "size": 50,
              "order": { "_count": "desc" }
            }
          }
        }
      }
    },
    "format": { "property": "aggregations.codes.buckets" }
  },

  "transform": [
    { "calculate": "datum.doc_count", "as": "count" },

    {
      "window": [
        { "op": "sum", "field": "count", "as": "cumulative" }
      ],
      "sort": [{ "field": "count", "order": "descending" }]
    },

    {
      "joinaggregate": [
        { "op": "sum", "field": "count", "as": "total" }
      ]
    },

    {
      "calculate": "datum.cumulative / datum.total * 100",
      "as": "cum_percent"
    }
  ],

  "encoding": {
    "x": {
      "field": "key",
      "type": "nominal",
      "title": "Status code",
      "sort": null
    }
  },

  "layer": [
    {
      "mark": "bar",
      "encoding": {
        "y": {
          "field": "count",
          "type": "quantitative",
          "title": "Count"
        }
      }
    },

    {
      "mark": { "type": "line", "color": "red", "point": true },
      "encoding": {
        "y": {
          "field": "cum_percent",
          "type": "quantitative",
          "title": "Cumulative %",
          "axis": { "grid": false }
        }
      }
    }
  ],

  "resolve": { "scale": { "y": "independent" } }
}

{
  "$schema": "https://vega.github.io/schema/vega-lite/v5.json",
  "title": "Heatmap: Avg duration per method and status_code",
  "data": {
    "url": {
      "%context%": true,
      "%timefield%": "@timestamp",
      "index": "logs-*",
      "body": {
        "size": 0,
        "aggs": {
          "combo": {
            "composite": {
              "size": 2000,
              "sources": [
                { "method": { "terms": { "field": "method" } } },
                { "status": { "terms": { "field": "status_code" } } }
              ]
            },
            "aggs": {
              "avg_duration": { "avg": { "field": "duration_ms" } },
              "p95": { "percentiles": { "field": "duration_ms", "percents": [95] } }
            }
          }
        }
      }
    },
    "format": { "property": "aggregations.combo.buckets" }
  },

  "transform": [
    { "calculate": "datum.key.method", "as": "method" },
    { "calculate": "toNumber(datum.key.status)", "as": "status" },
    { "calculate": "datum.avg_duration.value", "as": "duration" },
    { "calculate": "datum['p95']['values']['95.0']", "as": "p95" },
    { "filter": "isValid(datum.duration)" }
  ],

  "mark": {
    "type": "rect",
    "stroke": "#ffffff",
    "strokeWidth": 0.8
  },

  "encoding": {
    "x": {
      "field": "method",
      "type": "nominal",
      "title": "Method",
      "sort": ["GET", "POST", "PUT", "PATCH", "DELETE", "OPTIONS"]
    },

    "y": {
      "field": "status",
      "type": "ordinal",
      "title": "Status code",
      "sort": "ascending"
    },

    "color": {
      "field": "duration",
      "type": "quantitative",
      "title": "Avg duration (ms)",
      "scale": {
        "type": "sqrt",
        "scheme": "redyellowgreen",
        "reverse": true
      }
    },

    "tooltip": [
      { "field": "method", "title": "Method" },
      { "field": "status", "title": "Status code" },
      { "field": "duration", "title": "Avg", "format": ".2f" },
      { "field": "p95", "title": "p95 (ms)", "format": ".2f" }
    ]
  }
}
